import React from "react";
const {useState} = React;

const Searchbar = () => {
    const [search, setSearch] = useState('');

    const onChange = (evt) =>{
        setSearch(evt.tarjet.value); 
    }
    return (
        <div>
            <div>
                <input 
                placeholder="Buscar Pokemon..."
                onChange={onChange}
            />
            </div>
            <div>{search}</div>
        </div>
    )
} 

export default Searchbar;
